%-----------------------------------------------------------------
    % Normalize target measurements
    % now we are going to use relative measurements for characterization
    % abs 19 is white; 24 is black.
    white = absm(:, 20); % 19 + 1(wavelength)
    whitemat = repmat(white, [1, 25]);
    relm(:,2:25) = absm(:,2:25)./whitemat(:,2:25);
    relm(:,1) = absm(:,1);

    % normalize test measurements
    whiteA = A(:,20);
    whiteAmat = repmat(whiteA, [1, 25]);
    Am(:,2:25) = A(:,2:25)./whiteAmat(:,2:25);
    Am(:,1) = A(:,1);
%-----------------------------------------------------------------
%}    
    relm = absm;
    Am = A; % CASSI measurements from A
%-----------------------------------------------------------------
    startwv = absm(1,1);
    endwv = absm(end,1);
    
    % sub-sampled b from the spectroradiometer measurement b
    b1 = zeros(size(Am));
    for i=1:size(Am,1)
        for j=1:size(Am,2)
            waveidx = (Am(i,1) - startwv + 1);
            b1(i,j) = relm(waveidx,j);
        end
    end
        
    % remove wavelength column
    Amo = Am(:,2:end)'; % for making x 10x10 -> transpose
    bo = b1(:,2:end)';
    
    % A <-- CASSI measurements
    % b <-- spectroradiometer measurements
    % bx = A -> x = b\A
    x = Amo\bo;
    
    bo2 = Amo*x;
    b2 = cat(2,Am(:,1),bo2');
    
    CV1 = cv(Amo./max(max(Amo)), bo./max(max(bo))); % CV between CASSI (Amo) and spectroradiometer (bo)
    CV2 = cv(bo2, bo); % CV between characterized CASSI (bo2) and spectroradiometer (bo)
end
